贞爱岛田阳子》<br />岛田阳子（Yoko Shimada），1953年5月17日生，日本女星。1971年，当年十八岁的岛田阳子，参加电视剧《冰点》续集的女主角选拔，从一万多人中脱颖而出，因为名叫阳子，和三浦绫子“冰点”一书笔下的女主角同名，此剧也令她一炮而红，其后演出相当多的电视剧及电影，也获奖无数。1979年，岛田阳子凭借电影《将军》获得美国金球奖，从此跃上好莱坞的舞台，成为国际知名的日本女星，其作品也在美国产生轰动，是美国人眼中典型的东洋日本女人。岛田阳子自1990 年起四年间住在纽约，并拍摄美国的电视剧，1991年还成为法国亲善大使。岛田阳子曾在20世纪90年代后期前往中国发展，出演《英雄郑成功》等影视作品。2010年10月，岛田阳子以57岁的高龄拍摄A.V，正式在A.V界出道。 2010年10月，据日本媒体报道，岛田阳子被曝以57岁的高龄拍A.V，正式在A.V界出道。据看过A.V的人表示，她的身材和年轻时一样动人。　岛田拍摄的A.V由唱片公司MUTEKI制作发售，知情人透露片子是2010年夏天拍摄的，内容相当香艳，丰满的双胸一览无余。早在1992年，岛田就发售了性感的写真集，当时销量高达50万部。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:58:"BD$https://ethics.ppzuida.com/20170830/FU3v81ug/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i:27;a:80:{s:6:"vod_id";i:31283;s:7:"type_id";i:20;s:9:"type_id_1";i:0;s:8:"group_id";i:0;s:8:"vod_name";s:9:"春宫图";s:7:"vod_sub";s:0:"";s:6:"vod_en";s:10:"chungongtu";s:10:"vod_status";i:1;s:10:"vod_letter";s:1:"C";s:9:"vod_color";s:0:"";s:7:"vod_tag";s:0:"";s:9:"vod_class";s:6:"伦理";s:7:"vod_pic";s:77:"https://img.tupian-zuida.com/pic/upload/vod/2017-09-09/201709091504970779.png";s:13:"vod_pic_thumb";s:0:"";s:13:"vod_pic_slide";s:0:"";s:9:"vod_actor";s:63:"織田真子,山口真里,ホリケン。,なかみつせいじ";s:12:"vod_director";s:12:"藤原健一";s:10:"vod_write